import React, { useContext } from 'react';
import {
  RadarChart,
  PolarGrid,
  PolarAngleAxis,
  PolarRadiusAxis,
  Radar,
} from 'recharts';
import TeamMembersContext from '../../store/teamMembers-context';

const TeamStats = () => {
  const { teamSummary } = useContext(TeamMembersContext);

  return (
    <React.Fragment>
      <div className='container row'></div>
      <div className='container row bg-secondary'>
        <RadarChart
          outerRadius={90}
          width={730}
          height={250}
          data={teamSummary}
        >
          <PolarGrid />
          <PolarAngleAxis dataKey='powerstat' />
          <PolarRadiusAxis angle={30} domain={[0, 150]} />
          <Radar
            dataKey='value'
            stroke='#8884d8'
            fill='#8884d8'
            fillOpacity={0.6}
          />
        </RadarChart>
      </div>
    </React.Fragment>
  );
};

export default TeamStats;
